import { event } from 'jquery';
import React, { Component } from 'react'
import { Link } from 'react-router-dom';
import '../SignStyle.css';


export class SignUp extends Component {




    constructor(props) {
        super(props);
        this.state = { user_email: 'gamesy865@gmail.com', user_name: '', user_pass: '' };

        this.handleChange = this.handleChange.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);
    }

    handleChange(event) {
        this.setState({ user_email: event.target.value });
    }

    handleSubmit(event) {
        var emailInp = this.getElementById('email').value;

    
        event.preventDefault();
    }

    render() {
        return (
            <div>
                <div className="wrapper fadeInDown">
                    <div id="formContent">
                        <h2 className="active signh2"> Sign Up </h2>

                        <div className="fadeIn first mt-2 mb-2">
                            <i className="fa-solid fa-user fa-6x"></i>
                        </div>

                        <form onSubmit={this.handleSubmit}>
                            <input onChange={this.handleChange} type="text" id="email" className="fadeIn second" name="login" value={this.state.user_email} placeholder="Email adress" required minLength="8" maxLength="28" />
                            <input type="text" id="Veremail" className="fadeIn second" name="login" placeholder="Verify email" />
                            <input type="password" id="password" className="fadeIn third" name="login" placeholder="password" />
                            <input type="password" id="Verpassword" className="fadeIn third" name="login" placeholder="re-enter password" />
                            <input type="submit" className="fadeIn fourth" value="Sign up" />
                        </form>

                        <div id="formFooter">
                            <Link className="underlineHover" to="/login">Already a member ?</Link>
                        </div>

                    </div>
                </div></div>
        )
    }
}

export default SignUp
